$_MODULE['<{gamification}leodig>view_bt_cb3d475bd997e38c100704631dbab020'] = 'Avec toutes les fonctionnalités et les avantages que PrestaShop offre, il est important de garder en place!';
$_MODULE['<{gamification}leodig>view_bt_2c3193c85bb2555c333adfcfb824804a'] = 'L\'objectif principal de toutes les fonctionnalités que nous proposons est de vous faire réussir dans le monde de l\'e-commerce. Pour ce faire, nous avons créé un système de badges et des points qui font qu\'il est facile de surveiller vos progrès en tant que commerçant. Nous avons décomposé le système en trois niveaux, qui sont tous partie intégrante du succès dans le monde de l\'e-commerce: (i) votre utilisation des fonctionnalités clés e-commerce sur votre boutique, (ii) Votre performance des ventes, (iii) votre présence sur les marchés internationaux.';
